package com.test.grid.action;

public class stu {
	private String  name;
	private String sex;
	private String age;
	private String height;
	private String like;
	private String color;
	public stu(String name,String sex,String age,String height,String like,String color) {
		this.name=name;
		this.sex=sex;
		this.age=age;
		this.height=height;
		this.like=like;
		this.color=color;
	}
	public stu() {
		super();
		// TODO Auto-generated constructor stub
	}
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	public String getSex() {
		return sex;
	}
	public void setSex(String sex) {
		this.sex = sex;
	}
	public String getAge() {
		return age;
	}
	public void setAge(String age) {
		this.age = age;
	}
	public String getHeight() {
		return height;
	}
	public void setHeight(String height) {
		this.height = height;
	}
	public String getLike() {
		return like;
	}
	public void setLike(String like) {
		this.like = like;
	}
	public String getColor() {
		return color;
	}
	public void setColor(String color) {
		this.color = color;
	}
}
